  'msg_profile_interests': "–í—ã–±–µ—Ä–∏—Ç–µ –≤–∞—à–∏ –∏–Ω—Ç–µ—Ä–µ—Å—ã —Å –ø–æ–º–æ—â—å—é –∫–Ω–æ–ø–æ–∫. –ú–æ–∂–µ—Ç–µ –¥–æ–±–∞–≤–∏—Ç—å –∏ –¥—Ä—É–≥–∏–µ –∏–Ω—Ç–µ—Ä–µ—Å—ã, –ø–µ—Ä–µ—á–∏—Å–ª–∏–≤ –∏—Ö —á–µ—Ä–µ–∑ –∑–∞–ø—è—Ç—É—é –≤ –æ—Ç–≤–µ—Ç–Ω–æ–º —Å–æ–æ–±—â–µ–Ω–∏–∏. <a href=\"https://telegra.ph/Spisok-interesov-04-04\">–ü–æ–¥—Ä–æ–±–Ω–µ–µ –æ –∑–Ω–∞—á–µ–Ω–∏—è—Ö —Ç–µ–≥–æ–≤</a>.",
  'msg_editprofile_interests': "–í—ã —É–∫–∞–∑–∞–ª–∏ —Å–ª–µ–¥—É—é—â–∏–µ –∏–Ω—Ç–µ—Ä–µ—Å—ã: %interests%.\n\n–ß—Ç–æ–±—ã –∏–∑–º–µ–Ω–∏—Ç—å —Å–ø–∏—Å–æ–∫ –∏–Ω—Ç–µ—Ä–µ—Å–æ–≤, –≤—ã–±–µ—Ä–∏—Ç–µ –∏—Ö —Å –ø–æ–º–æ—â—å—é –∫–Ω–æ–ø–æ–∫ –∏–ª–∏ –æ—Ç–ø—Ä–∞–≤—å—Ç–µ —á–µ—Ä–µ–∑ –∑–∞–ø—è—Ç—É—é –≤ –æ—Ç–≤–µ—Ç–Ω–æ–º —Å–æ–æ–±—â–µ–Ω–∏–∏. <a href=\"https://telegra.ph/Spisok-interesov-04-04\">–ü–æ–¥—Ä–æ–±–Ω–µ–µ –æ –∑–Ω–∞—á–µ–Ω–∏—è—Ö —Ç–µ–≥–æ–≤</a>.",
