  'msg_editprofile_photo': "<b>–û—Ç–ø—Ä–∞–≤—å—Ç–µ —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏—é, –∫–æ—Ç–æ—Ä–∞—è –±—É–¥–µ—Ç –æ—Ç–æ–±—Ä–∞–∂–∞—Ç—å—Å—è –≤ –≤–∞—à–µ–π –∞–Ω–∫–µ—Ç–µ</b>.\n\n–†–µ–∫–æ–º–µ–Ω–¥—É–µ–º –∑–∞–≥—Ä—É–∑–∏—Ç—å –∫–∞—á–µ—Å—Ç–≤–µ–Ω–Ω—ã–π —Å–Ω–∏–º–æ–∫, –Ω–∞ –∫–æ—Ç–æ—Ä–æ–º –≤–∞—Å —Ö–æ—Ä–æ—à–æ –≤–∏–¥–Ω–æ. <b>–ù–∞—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ –ø—Ä–æ—Å–∏–º –Ω–µ –∑–∞–≥—Ä—É–∂–∞—Ç—å —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏–∏ –ø–æ—Å—Ç–æ—Ä–æ–Ω–Ω–∏—Ö –ª–∏—Ü, –∞ —Ç–∞–∫–∂–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è, –∫–æ—Ç–æ—Ä—ã–µ –º–æ–∂–Ω–æ —Å—á–µ—Å—Ç—å –ø–æ—Ä–Ω–æ–≥—Ä–∞—Ñ–∏—á–µ—Å–∫–∏–º–∏.</b> –ò—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Ä–∏—Å—É–Ω–∫–∏ –∏ –¥—Ä—É–≥–∏–µ –∫–∞—Ä—Ç–∏–Ω–∫–∏ —Ç–æ–∂–µ –Ω–µ —Å—Ç–æ–∏—Ç ‚Äî —ç—Ç–æ —Å–Ω–∏–∑–∏—Ç –∏–Ω—Ç–µ—Ä–µ—Å –∫ –≤–∞—à–µ–π –∞–Ω–∫–µ—Ç–µ.",

